import React from 'react'
import { Input, Row, Col, Layout,Button } from 'antd'
import styled from 'styled-components';

const { Header, Footer, Sider, Content  } = Layout;
const { Search } = Input;

const StyledSearch = styled(Search)`
.ant-input-affix-wrapper{
    border-style: solid !important;
    border-width: 0px 0px 1px 0px !important;
    border-color: white !important;
},
.ant-input{
  padding-left: ${({theme})=>theme.spacing.large} !important;
}`

const StyledButton = styled(Button)`
  color: palevioletred  !important;
  font-weight: normal;
  :focus {
    color: palevioletred;
    border-color: palevioletred;
  }
  :hover {
    color: palevioletred;
    border-color: palevioletred;
  }
  &.ant-btn-clicked:after {
    content: '';
    position: absolute;
    top: -1px;
    left: -1px;
    bottom: -1px;
    right: -1px;
    border-radius: inherit;
    border: 0 solid palevioletred;
    opacity: 0.4;
    -webkit-animation: buttonEffect 0.4s;
    animation: buttonEffect 0.4s;
    display: block;
  }
`;
export default function CustomerServicesMenu() {
  return (
    <div>
      <Layout>
        {/* <Content> */}
          <Row>
            <Col span={12}>Account Unbinding</Col>
            <Col span={12}> OTP Unlocking</Col>
          </Row>
          <Row>
          {/* <StyledButton>test</StyledButton> */}

            <StyledSearch
              prefix="input card number"
              placeholder="input search text"
              enterButton="Search"
              size="large"
              onSearch={value => console.log(value)}
            />
          </Row>
        {/* </Content> */}
      </Layout>
    </div>
  )
}
